import React from 'react';
import ReactDOM from 'react-dom/client';
import { useState } from 'react';
import { isEmpty, isValidEmail } from './someValidators';


function EmpId() {
    const[empId, showEmpId] = useState("");
    return <h2>Employee Id : {empId} </h2>
}

function EmpName() {
    const[empName, setEmpName] = useState("");
    return (
        <>
        <h2>Employee Name : </h2>
        <input type="text" value={empName} onChange={(e) => setEmpName(e.target.value)} />
        </>
    );
}

function DateOfBirth() {
    const[dob, setDob] = useState("");
    return (
        <>
        <h2>Date of Birth : </h2>
        <input type="date" value={dob} onChange={(e) => setDob(e.target.value)} />
        </>
    );
}

function EmailId() {
    const[emailId, setEmailId] = useState("");
    return (
        <>
        <h2>Email Id : </h2>
        <input type="text" value={emailId} onChange={(e) => setEmailId(e.target.value)} />
        </>
    );
}

